import axios from "axios";
import { useState } from "react";
import { useEffect } from "react";
import userdata from '../App';
export function Chats (){

    const [friends, setFriends] = useState([]);
    useEffect(() => {
        axios.get(`http://127.0.0.1:8000/api/v1/Friends/1/`)
            .then(response => {
                setFriends(response.data);
                console.log(response.data);
            })
            .catch(error => {
                console.error('Error fetching data:', error);
            });
    }, []);
    const [chat,setChat] = useState(1);
    const toggleChat = (index)=>{
        setChat(index);
    }

    return(
    <>
        {friends.map(item => {
        return(
            <div class="chat" key={item.id}>
            <img src={`http://127.0.0.1:8000${item.friend_avatar}`} alt="Friend Avatar"/>
            <span class="chat_name">{item.friend_name}</span>
        </div>);
        })}
    </>
    )
}
